async function linhasfun(origemEnd, destinoEnd){
    let resultCru = await buscarLinhas(origemEnd, destinoEnd);
    const origem = resultCru[0]
    const destino = resultCru[1]
    resultCru = resultCru[2]
    
    const onibus = resultCru.map(item => ({linha: item.numero, sentido: item.sentido}));

    return [origem, destino, onibus]
}

function calcularDistancia(coord1, coord2) {
    const R = 6371e3; // metros
    const [lat1, lon1] = coord1.map(c => c * Math.PI/180); // converte graus para radianos
    const [lat2, lon2] = coord2.map(c => c * Math.PI/180);
    const deltaLat = lat2 - lat1;
    const deltaLon = lon2 - lon1;

    const a = Math.sin(deltaLat/2) * Math.sin(deltaLat/2) +
            Math.cos(lat1) * Math.cos(lat2) *
            Math.sin(deltaLon/2) * Math.sin(deltaLon/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));

    return R * c; 
}

async function encontrarCoordenadaMaisProxima(coordenadaUsuario, coordenadas) {
    let menorDistancia = Infinity;
    let coordenadaMaisProxima;

    coordenadas.forEach((coord) => {
        const distanciaAtual = calcularDistancia(coordenadaUsuario, coord.coordenadas);
        if (distanciaAtual < menorDistancia) {
            menorDistancia = distanciaAtual;
            coordenadaMaisProxima = coord;
        }
    });

    return [coordenadaMaisProxima['codigo'], coordenadaMaisProxima['coordenadas']];
}


async function enderecoParaCoordenadas(endereco) {
    const resposta = await axios.get('https://nominatim.openstreetmap.org/search', {
        params: {
            q: endereco,
            format: 'json',
        },
    });
    const localizacao = resposta.data[0];
    return [parseFloat(localizacao.lat), parseFloat(localizacao.lon)];
}

